import { Link, Router } from "react-router-dom";

const Footer = () => {
	return (
		<div className='Footer'>
			<ul>
				<li>
		       		<a href="https://facebook.com/">facebook</a>
		        </li>
		    </ul>
		    <ul>
				<li>
		       		<a href="https://facebook.com/">bandcamp</a>
		        </li>
		    </ul>
		    <ul>
				<li>
		       		<a href="https://www.instagram.com/explore/tags/pressuresensitiveband/">instagram</a>
		        </li>
		    </ul>
  		</div>
	);
}

export default Footer;
